const DeleteButton = (props) => {

  return (

      <div>

        <button className="btn btn-danger" onClick={() => props.handleDelete(props.dinosaur)}>Delete {props.dinosaur.name}</button>
        
      </div>
    )
  }

export default DeleteButton
